import React, { Component } from "react";

class CommentBox extends Component {
  constructor(props) {
    super(props);
    this.state = {
      _isReadOnly: this.props.isReadonly,
    };
  }
  render() {
    return <input type="text" readOnly={this.state._isReadOnly}></input>;
  }
}

export default CommentBox;
